export function PatientView(props: Props) {
  const { route, navigation } = props
  const { patient } = route.params
  const isDarkmode = useColorScheme() === "dark"
  const [clinic, provider] = useProviderStore((store) => [store.clinic, store.provider])

  const snapshotForms = useDBEventForms(translate("languageCode"))

  // const [snapshotForms, setSnapshotForms] = useState<EventFormModel[]>([])
  // useEffect(() => {
  //   database.get<EventFormModel>("event_forms")
  //     .query(
  //       Q.where("language", translate("languageCode")),
  //       Q.where("is_snapshot_form", true)
  //     ).fetch().then((forms) => {
  //       setSnapshotForms(forms)
  //     })

  // }, [])



  const fetchPatientData = async (patientId: string, ignoreEmptyVisits: boolean): Promise<{ visit: VisitModel, events: EventModel[] }[]> => {
    const visits = await database
      .get<VisitModel>("visits")
      .query(Q.and(Q.where("patient_id", patientId), Q.where("is_deleted", false)))
      .fetch()

    const events = await database.get<EventModel>("events")
      .query(Q.and(Q.where("patient_id", patientId), Q.where("is_deleted", false)))
      .fetch()


    const results = visits.map(visit => {
      return {
        visit,
        events: events.filter(ev => ev.visitId === visit.id)
      }
    })

    if (ignoreEmptyVisits) {
      return results.filter(res => res.events.length > 0)
    }
    return results;
  }


  const downloadFile = async (patient: Patient, summary = translate("noContent")) => {
    const latestSummaryEvent = await getLatestPatientEventByType(patient.id, "Patient Summary")
    const latestVitalsEvent = await getLatestPatientEventByType(patient.id, "Vitals")

    var height = translate("noContent")
    var weight = translate("noContent")

    if (latestVitalsEvent && Object.keys(latestVitalsEvent).length > 0) {
      const vitalsTaken = Object.keys(latestVitalsEvent)

      vitalsTaken.forEach(vital => {
        if (vital.toLowerCase().includes("weight")) {
          weight = latestVitalsEvent[vital as any]
        } else if (vital.toLowerCase().includes("height")) {
          height = latestVitalsEvent[vital as any]
        }
      })
    }

    printHTML(patient, latestSummaryEvent.summary?.length > 0 ? latestSummaryEvent.summary : summary, height, weight)

  }


  async function printHTML(patient: Patient, summary: string, height: string, weight: string) {

    const logoStr = "data:image/png;base64,"

    fetchPatientData(patient.id, true).then(async (result) => {
      const visitsList = result.map(({ events, visit }) => {
        const eventRows = events.map(ev => {
          const evs = getEventDisplayPrint(ev);
          return `
            <div class="mb-18">
              <p style="color: #1e3a8a; font-weight: bold;" class="m-0">Form: ${ev.eventType}</p>
              <p class="m-0 mb-4">Provider: ${visit.providerName}</p>

              <p class="m-0 mb-4">Results:</p>
              <div>
                ${evs}
              </div>
            </div>`

        }).join("")
        return `
          <div class="mb-38">
            <h4 class="mb-0">${format(visit.checkInTimestamp, "dd MMMM yyyy")}</h4>
            <hr color="#1e3a8a" />

            ${eventRows}               
          
            <br />
          </div>
          `
      }).join("")
      // const visitsList_ = result.map(visit =>
      //   `${visit.providerName} \n
      //     ${translate("visitDate")}: ${format(visit.checkInTimestamp, "dd MMM yyyy")}`
      // )

      const patientFullName = `${patient.givenName} ${patient.surname}`
      await RNPrint.print({
        html: `
      <div style="">
        <div class="flex justify-between wide">
          <h1>${translate("patientReport.patientMedicalRecord")}</h1>
          <img src=${logoStr} style="height: 40px; width: 40px;" />
        </div>
        <div class="patient-info-container" style="">
          <div class="flex">
            <div style="flex: 1">
                <h3 class="mb-0">${translate("patientReport.PatientInformation")}</h3>
                ${patientFullName}

                <br>
                <br>
                ${patient.additionalData && Object.entries(patient.additionalData).map(v => "<p>" + v[0] + ": " + v[1] + "</p>").join("")}
                <br>
                ${upperFirst(translate(patient.sex as any || ""))}

                <br>
                <br>
                ${patient.country}
            </div>

            <div style="flex: 1">
                <h3 class="mb-0">${translate("dob")}</h3>
                ${localeDate(new Date(patient.dateOfBirth), "MMMM dd yyyy", {})}

                <h3 class="mb-0">${translate("weight")}</h3>
                ${weight}

                <h3 class="mb-0">${translate("height")}</h3>
                ${height}
            </div>
          </div>


          <div>
            <h3 class='mb-0'>${translate("patientSummary")}</h3>
            ${summary}
          </div>
        </div>


        <div>
            <h3>${translate("visitHistory")}</h3>
            ${visitsList}
        </div>


        <style>
          h1 {
              font-size: 40px;
              color: #1e3a8a;
          }

          h3 {
              font-size: 18px;
              color: #1e3a8a;
          }

          h4 {
              color: #1e3a8a;
          }

          .wide {
            width: 100%;
          }

          .flex {
              display: flex;
          }
          .justify-between {
            justify-content: space-between
          }

          .patient-info-container {
              background-color: #eff6ff;
              border-radius: 10px;
              padding: 20px;
          }

          .m-0 {
              margin: 0px;
          }
          .mb-0 {
              margin-bottom: 0px;
          }
          .mb-4 {
              margin-bottom: 4px;
          }
          .mb-18 {
              margin-bottom: 18px;
          }
          .mb-38 {
              margin-bottom: 38px;
          }
        </style>
      </div>`
      })
    })
  }

  const goToEditPatient = () => {
    navigation.navigate("NewPatient", { patient })
  }
  const goToNewPatientVisit = () => {
    if (!provider || !patient || !clinic) {
      // TODO: Handle error
      return
    }
    createVisit({
      providerId: provider.id,
      providerName: provider.name,
      patientId: patient.id,
      clinicId: clinic.id,
      isDeleted: false,
      metadata: {},
      checkInTimestamp: new Date().getTime(),
    })
      .then((res) => {
        navigation.navigate("NewVisit", {
          patientId: patient.id,
          patientAge: calculateAgeInYears(new Date(patient.dateOfBirth)),
          providerId: provider.id,
          visitId: res.id,
          visitDate: new Date().getTime()
        })
        console.log(res)
      })
      .catch((error) => console.error(error))
  }

  let links = patientLinks(patient.id, patient, "")

  const renderItem = useCallback(
    ({ item }: { item: PatientLink }) => <LinkItem link={item} navigation={navigation} />,
    [],
  )


  return (
    <>
      <Screen preset="scroll" style={$screen}>
        <PatientFileSummary patient={patient} goToEditPatient={goToEditPatient} downloadFile={downloadFile} />

        <FlatList
          data={links}
          contentContainerStyle={$linksContainer}
          renderItem={renderItem}
          keyExtractor={(item) => item.labelTx}
        />
        {
          snapshotForms.map(form => (
            <List.Item
              key={form.id}
              title={form.name}
              right={(props) => <List.Icon {...props} icon="chevron-right" />}
              onPress={() => navigation.navigate("SnapshotList", {
                patientId: patient.id, eventType: form.name
              })}
              description={form.description}
              left={(props) => <List.Icon {...props} icon={"form-select"} />}
            />
          ))
        }

        <View style={{ height: 80 }} />
      </Screen>
      <FAB icon="plus" color="white" label={translate("patientView.newVisit")} style={$fab} onPress={goToNewPatientVisit} testID="newPatientVisitBtn" />
    </>
  )
}

const LinkItem = ({
  link,
  navigation,
}: {
  link: PatientLink
  navigation: NativeStackNavigationProp<any>
}) => {
  return (
    <List.Item
      key={link.labelTx}
      title={translate(link.labelTx)}
      right={(props) => <List.Icon {...props} icon="chevron-right" />}
      onPress={() => navigation.navigate(link.route, link.params)}
      description={translate(link.descriptionTx)}
      left={(props) => <List.Icon {...props} icon={link.iconName} />}
    />
  )
}

const PatientFileSummary = ({
  patient,
  goToEditPatient,
  downloadFile,
}: {
  patient: Patient
  goToEditPatient: () => void
  downloadFile: (patient: Patient, summary?: string) => void
}) => {
  return (
    <View style={$summaryContainer}>
      <View style={$avatarContainer}>
        <Avatar.Text
          style={{ backgroundColor: primary }}
          size={96}
          label={displayNameAvatar(patient)}
        />
      </View>
      <View style={$summaryTextContainer}>
        <View style={$nameRow}>
          <Text variant="titleLarge">{displayName(patient)}</Text>
          <Button icon="pencil" mode="text" onPress={goToEditPatient}>
            {translate("edit")}
          </Button>
        </View>
        <Text>{`${translate("dob")}: ${localeDate(new Date(patient.dateOfBirth), "yyyy MMM dd", {})}`}</Text>
        <Text>{`${translate("sex")}: ${translate(patient.sex as "male" | "female")}`}</Text>
        <PatientSummary patientId={patient.id} />

        <Button icon="download" mode="text" onPress={() => downloadFile(patient)}>
          {translate("downloadPatientHistory")}
        </Button>
      </View>
    </View>
  )
}

